async () => {
  try {
    await Select_IScaling_All.run();
    const scale_data = Select_IScaling_All.data;
    await Dockets.run();
    const docket_set = new Set(Dockets.data.map(item => item.Docket));
    await Logs.run();
    const log_set = new Set(Logs.data.map(item => item.Log));
    await Grade.run();
    const grade_set = new Set(Grade.data.map(item => item.Grade));
    await Lengths.run();
    const length_set = new Set(Lengths.data.map(item => item.Lengths));
    await Location.run();
    const location_set = new Set(Location.data.map(item => item.Location));
    console.log("starting");
    console.log(log_set);
    const {del_log, scale} = scale_data.reduce((acc, sr) => {
      const logs_to_go = () => acc.del_log.push([sr.Log]);
      const valid = () => acc.scale.push([sr.Log, sr.Docket, sr.Grade, sr.Length, sr.Diameter, sr.JAS, sr.Location, sr.Date]);
      if (!log_set.has(sr.Log)) {
        if (!location_set.has(sr.Location) || sr.Location === 'TEST') {
          logs_to_go();
        } else if (isNaN(sr.Docket)) {} else if (!docket_set.has(parseInt(sr.Docket))) {} else if (sr.Diameter < 16 || sr.Diameter > 48 || isNaN(sr.Diameter)) {} else if (!length_set.has(sr.Length)) {} else if (!grade_set.has(sr.Grade)) {} else {
          valid();
          console.log("valid");
          logs_to_go();
        }
      } else {
        logs_to_go();
        console.log("to be deleted", sr.Log);
      }
      return acc;
    }, {
      scale: [],
      del_log: []
    });
    console.log("processed", scale.length, del_log.length);
    if (scale.length > 0) {
      const data = scale.map(item => `(${item.map(val => `'${val}'`).join(',')})`).join(',');
      Insert_VScaling.run({
        'data': data
      }).then(() => showAlert("Found Valid Scaling Entires", 'success')).catch(error => showAlert(error, 'error'));
    }
    if (del_log.length > 0) {
      const idata = del_log.map(val => `'${val}'`).join(',');
      console.log(idata);
      Delete_Invalid_ScalingRows.run({
        'data': idata
      }).then(() => showAlert("Deleted Invalid Scaling Entires", 'success')).catch(error => showAlert(error, 'error'));
    }
    Count_Scaling.run();
  } catch (error) {
    showAlert(error, 'error');
  }
}

